import React from "react";
import SidebarElements from './SidebarElements';
function Sidebar() {
    return (
        <>
            <div className="">
                <SidebarElements width={175} height={"100vh"}>
                    <div className="textGradient">
                        <div className="sideText">
                            <a>HOME</a>
                            <a>NOTICIAS</a>
                            <a>CREADOR</a>
                            <a>USUARIO </a>
                            <a>REPRODUCTOR</a>
                        </div>
                    </div>
                </SidebarElements>
            </div>
        </>
    );
}

export default Sidebar;
